import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open the cart modal (by clicking on the cart div)
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for the cart modal to appear
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    await page.waitForSelector('#cartModal', { state: 'visible', timeout: 5000 });

    // Take screenshot of cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_open.png'));

    // Check if there is any "Remove" button (remove-item class)
    const removeButtons = await page.$$('.remove-item');
    let removedTitle = null;

    if (removeButtons.length > 0) {
      // Get the title of the first cart item (for verification)
      const cartItemTitle = await page.$eval('.cart-item-title', el => el.textContent.trim());
      removedTitle = cartItemTitle;

      // Click the first "Remove" button
      await removeButtons[0].click();

      // Wait for the cart to update (the item to be removed)
      await page.waitForTimeout(500); // Small wait for UI update

      // Take screenshot after removal
      await page.screenshot({ path: path.join(screenshotsDir, 'step_3_item_removed.png') });
      screenshots.push(path.join(screenshotsDir, 'step_3_item_removed.png'));

      // Check if the item is gone (look for empty cart message or absence of the title)
      let cartEmpty = false;
      let itemStillPresent = false;
      try {
        await page.waitForSelector('.empty-cart', { timeout: 2000 });
        cartEmpty = true;
      } catch {
        // If not empty, check if the removed title is still present
        const titles = await page.$$eval('.cart-item-title', els => els.map(e => e.textContent.trim()));
        itemStillPresent = titles.includes(removedTitle);
      }

      return {
        success: cartEmpty || !itemStillPresent,
        action: "Removed an item from the cart",
        extractedData: {
          removedTitle,
          cartEmpty,
          itemStillPresent
        },
        screenshots,
        error: null
      };
    } else {
      // No items to remove
      return {
        success: true,
        action: "No items in cart to remove",
        extractedData: {
          removedTitle: null,
          cartEmpty: true,
          itemStillPresent: false
        },
        screenshots,
        error: null
      };
    }
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
